// main.js
import Vue from 'vue';
import App from './App.vue';
import Toast from 'vue-toasted';
import 'vue-toasted/dist/vue-toasted.css'; // Fix import path

Vue.use(Toast);

new Vue({
    render: (h) => h(App),
}).$mount('#app');
